import React from 'react';
import { Link, NavLink, Outlet } from 'react-router-dom';
import logo from '../IIITH_logo.png';
import 'bootstrap/dist/css/bootstrap.css';


const Layout = () => {
  return (
    <div>
      {/* Logo */}
      <img src={logo} alt="Logo" />

      {/* Heading */}
      <h1>Visual Inspection Tool</h1>

      {/* Navigation Bar */}
      <nav>
        <ul>
          <li>
            <NavLink to="/dataset" activeClassName="active">
              Dataset
            </NavLink>
            <ul className="dropdown-menu">
              <li>
                <NavLink to="/dataset/view">View Dataset</NavLink>
              </li>
              <li>
                <NavLink to="/dataset/upload">Upload Dataset</NavLink>
              </li>
            </ul>
          </li>
          <li>
            <NavLink to="/model">Model</NavLink>
            <ul className="dropdown-menu">
              <li>
                <NavLink to="/model/train">Train Model</NavLink>
              </li>
            </ul>
          </li>
          <li>
            <NavLink to="/logout">Logout</NavLink>
          </li>
        </ul>
      </nav>

      {/* Render the current route */}
      <Outlet />
    </div>
  );
};

export default Layout;
